tables.table_schema:
CREATE TABLE SolarPowerGeneration (
    id SERIAL PRIMARY KEY,
    date DATE,
    power_generation FLOAT,
    capacity FLOAT
);

CREATE TABLE weather_data (
  date DATE,
  temperature FLOAT,
  humidity FLOAT,
  wind_speed FLOAT
);

CREATE TABLE solar_panel (
  panel_id INT,
  location VARCHAR,
  efficiency FLOAT,
  capacity FLOAT
);

CREATE TABLE power_generation (
  date DATE,
  panel_id INT,
  generated_power FLOAT,
  efficiency FLOAT
);
